DESCRIPTION:
Eismas Antakalnyje, Mileišiškių gatvėje. 
Nesilaikoma saugaus eismo taisyklių keliant grėsmę nuosavų namų gyventojams, ypač mažamečiams. Važiuojantieji iš Moliakalnio gatvės į Mileišiškių nepaiso pastatytų saugaus eismo kelio ženklų (40km/h), lekia pasismagindami ir Mileišiškių gatvėje (ties Viršupio sodų 1-ąja g.)  esantį kalniuką tiesiog oru praskrenda (80-120km/h). Mileišikių gatvė yra su šaligatviais, gyvena šeimos su vaikais, važinėja dviratininkai, vaikai su paspirtukais. Lakstūnai tiesiog neleidžia saugiai pereiti kelio į stotelę ar joje saugiai laukti autobuso. Prašymas:
1. įrengti ženklus, jog Mileišiškių gatvė yra &#34;Gyvenamoji Zona&#34;; 
2. įrengti žiedą Viršupio ir Mileišiškių gatvės sankirtoje, arba kitomis priemonėmis suvaldyti greitį &#34;atlekiančių&#34; iš Moliakalnio gatvės.
3. inicijuoti periodinius greičio matavimus, pasitelkiant kelių policiją;
4. peržiūrėti iš kur toks įtensyvus sunkiųjų mašinų eismas Mileišiškių gatvėje ir jį suvaldyti.
